import { BrowserRouter as Router } from "react-router-dom";
import React from "react";
import {
  Heading,
  Container,
  Card,
  CardBody,
  CharacterName,
  CardFooter,
  CardDetailsLink,
} from "./styles";

const Characters = () => {
  return (
    <>
      <Heading>Star Wars Characters</Heading>
      <Container>
        <Card>
          <CardBody>
            <CharacterName>Name</CharacterName>
          </CardBody>
          <CardFooter>
            <Router>
              <CardDetailsLink to="/">Details</CardDetailsLink>
            </Router>
          </CardFooter>
        </Card>
      </Container>
    </>
  );
};

export default Characters;
